import "../styles/Dashboard.css";
import React, { useEffect, useState } from "react";
import axios from "axios";

import {
  Chart as ChartJS,
  BarElement,
  CategoryScale,
  LinearScale,
  Tooltip,
  Legend
} from "chart.js";
import { Bar } from "react-chartjs-2";

ChartJS.register(BarElement, CategoryScale, LinearScale, Tooltip, Legend);

function OrganizerDashboard() {
  const [bookings, setBookings] = useState([]);
  const [totalBookings, setTotalBookings] = useState(0);
  const [totalRevenue, setTotalRevenue] = useState(0);
  const [filter, setFilter] = useState("total");

  const fetchData = async () => {
    try {
      const bookingsRes = await axios.get(
        `http://localhost:8080/api/bookings`
      );
      const totalRes = await axios.get(
        `http://localhost:8080/api/bookings/total`
      );
      const revenueRes = await axios.get(
        `http://localhost:8080/api/bookings/revenue`
      );

      setBookings(bookingsRes.data);
      setTotalBookings(totalRes.data);
      setTotalRevenue(revenueRes.data);
    } catch (error) {
      console.error("Error fetching dashboard data", error);
    }
  };
useEffect(() => {
  fetchData
}, [darkMode]);

  return (
    <div className="dashboard-container">
   
      {/* Header */}
      <div className="dashboard-header">
        <h1>Organizer Dashboard</h1>
      </div>

      {/* Summary Cards */}
      <div className="summary-container">
        <div className="summary-card">
          <h3>Total Bookings</h3>
          <p>{totalBookings}</p>
        </div>

        <div className="summary-card">
          <h3>Total Revenue</h3>
          <p>₹{totalRevenue}</p>
        </div>
      </div>

      {/* Revenue Chart */}
      <div className="chart-container">
  <div className="chart-header">
    <h3>Revenue Overview</h3>

    <select
      className="chart-filter"
      value={filter}
      onChange={(e) => setFilter(e.target.value)}
    >
      <option value="total">Total</option>
      <option value="double">Projected</option>
    </select>
  </div>

  <Bar
    data={{
      labels: ["Revenue"],
      datasets: [
        {
          label: "Revenue",
          data: [
            filter === "total"
              ? totalRevenue
              : totalRevenue * 2
          ],
          backgroundColor: "#4f46e5"
        }
      ]
    }}
  />
</div>
      {/* Booking Table */}
      <h2>Booking Details</h2>
      <table className="booking-table">
        <thead>
          <tr>
            <th>Booking ID</th>
            <th>Event ID</th>
            <th>Seats Booked</th>
            <th>Total Amount</th>
            <th>Booking Date</th>
          </tr>
        </thead>
        <tbody>
  {bookings.map((booking) => (
    <tr key={booking.id}>
      <td>{booking.id}</td>
      <td>{booking.eventId ?? "N/A"}</td>
      <td>{booking.seatsBooked}</td>
      <td>₹{booking.totalAmount}</td>
      <td>{new Date(booking.bookingDate).toLocaleString()}</td>
    </tr>
  ))}
</tbody>
      </table>
    </div>
  );
}

export default OrganizerDashboard;
